
def skew(s):
    G, C = "G", "C"
    return s.count(G) - s.count(C)

def min_skew(skews):
    [index, value] = min(zip(range(len(skews)), skews), key=lambda item: item[1])
    return index, value

def min_skew_indexes(s):
    result = []
    skews = [skew(s[:i]) for i in range(len(s) + 1)]
    index, value = min_skew(skews)
    result.append(str(index))
    del skews[index]
    while True:
        i, v = min_skew(skews)
        if v == value:
            result.append(str(i + len(result)))
            del skews[i]
        else:
            break
    return result

g = ""
print(" ".join(min_skew_indexes(g)))